import React, { Component } from "react";
import { Link } from "react-router-dom";
import MediaQuery from "react-responsive";

import "../styles/HomeWeb.css";
import "../styles/HomeMobile.css";
import "../styles/HomeTablet.css";

import NavBar from "../components/navbar";
import WelcomeTextWeb from "../components/welcomeTextWeb";
import WelcomeTextTablet from "../components/welcomeTextTablet";
import WelcomeTextMobile from "../components/welcomeTextMobile";

import Zoom from "react-reveal/Zoom";
import Fade from "react-reveal/Fade";

import downArrow from "../resources/images/downArrow.png";

class Home extends Component {
  render() {
    return (
      <div class="home">
        <NavBar></NavBar>

        <MediaQuery query="(min-device-width: 1224px)">
          <MediaQuery query="(min-width: 1224px)">
            <WelcomeTextWeb />
            <div>You are a desktop or laptop</div>
          </MediaQuery>
          <MediaQuery query="(max-width: 1224px)">
            <WelcomeTextTablet />
            <div>
              You are a desktop sized like a tablet or mobile phone though
            </div>
          </MediaQuery>
        </MediaQuery>

        <MediaQuery query="(max-device-width: 1224px)">
          <MediaQuery query="(min-device-width: 500px)">
            <WelcomeTextTablet />
          </MediaQuery>

          <MediaQuery query="(max-device-width: 500px)">
            <div class="WelcomeTextMobile">
              <Fade>
                <h1>Welcome to Aux.</h1>
              </Fade>
              <Fade bottom>
                <hr />
              </Fade>
              <Fade bottom>
                <h3>
                  A group listening experience where everyone is on the aux.
                </h3>
              </Fade>
              <Fade bottom>
                <img className="downArrow" src={downArrow} alt="" />
              </Fade>
            </div>
          </MediaQuery>

          <MediaQuery query="(orientation: portrait)">
            <div>You are portrait</div>
          </MediaQuery>
          <MediaQuery query="(orientation: landscape)">
            <div>You are landscape</div>
          </MediaQuery>
        </MediaQuery>

        <Link styles={{ margin_top: "200px" }} to="/signUp">
          Go to sign up
        </Link>
      </div>
    );
  }
}

export default Home;
